import React from 'react';
 
 function Contact() {
     return (
         <section className="contact" id='contacts'>
             <h2>Contato</h2>
             <p>Email: thomas_neves@ymail.com</p>
             <p>WhatsApp: +55 11 96784-1671</p>
 
         </section>
     );
 }
 
 export default Contact;
